local time=0 --time

function TIC()
 endScreen()
 if section == "game" then
  gameloop()
 end
	if section == "start" then
	 startScreen()
	end
	--if section == "gameover" then
	-- endScreen()
	--end
end

function gameloop()
 map()
 time=time+1
 print(#inairf)
 
 if time%35==0 then
  addFood()
 end
 initGame()
 moveplayer1()
 moveplayer2()
 drawplayers()
 pickup()
 throwfruit()
 drawthrown()
 movefruits()
end

function initGame()
 drawGraphics()
end

function addFood()
 val = math.random(1,10)
 side = math.random(0,1)
 tablepos = math.random(0,4)
 newfood={x=0,y=0}
	for i=1,max_food do
		if side==1 then --right side
		 xpos=tablepos*16+164
			tablenum=tablepos+5
		else --left side
		 xpos=tablepos*16+4
			tablenum=tablepos+1
		end
		if foodos<=10 and tables[tablenum]~=1 then
		 table.insert(ammofood,#ammofood+1,{id=foods[val],x=xpos,y=tabletop,tnum=tablenum})
	  foodos=foodos+1
			tables[tablenum]=1
	 end
	end
end

function throwfruit()
 if key(23) and p1.item==1 then
  throws1=throws1+1
  p1.item = 0
  table.insert(inairf,#inairf+1,{id = p1.itemid, xpos=p1.x+3,ypos=y-1, xvel = 3, yvel =-7})
 end
 if key(58) and p2.item==1 then
  throws2=throws2+1
  p2.item = 0
  table.insert(inairf,#inairf+1,{id = p2.itemid, xpos=p2.x+3,ypos=y-1, xvel = -3, yvel=-7})
 end
end

function drawthrown()
  for i,v in ipairs(inairf) do
    spr(v.id, v.xpos,v.ypos, 0)
  end
end

function movefruits()
 for i,v in ipairs(inairf) do
  v.xpos = v.xpos + v.xvel
  v.ypos = v.ypos + v.yvel
  v.yvel = v.yvel + 0.5
  if p1.x >= v.xpos-3 and p1.x <= v.xpos+3 and v.ypos>=y then
   p1.state = 1
   v.yvel = 0
   v.xvel = 0
   hits2=hits2+1
  end
  if p2.x >= v.xpos-3 and p2.x <= v.xpos+3 and v.ypos>=y then
   p2.state = 1
   v.yvel = 0
   v.xvel = 0
   hits1=hits1+1
  end
  if hits1 or hits2 > 15 then
   --section="gameover"
   endScreen()
  end
 end
end

function drawGraphics()
	for i=1,#ammofood do
 	spr(ammofood[i].id,ammofood[i].x,ammofood[i].y,0)
 end
end

function pickup()
 if key(19) and p1.item==0 then
  local i=1
  while i <= #ammofood do   
	  v = ammofood[i]   
   if p1.x >= v.x-3 and p1.x <= v.x+3 then
    p1.item = 1
    p1.itemid = v.id
    tables[ammofood[i].tnum]=0
    table.remove(ammofood, i)
    foodos=foodos-1
   else
   	i = i + 1
   end
  end
 end
  
 if key(59) and p2.item==0 then
  local i=1
  while i <= #ammofood do 
	  v = ammofood[i]     
   if p2.x >= v.x-10 and p2.x <= v.x+10 then
    p2.item = 1
    p2.itemid = v.id
    tables[ammofood[i].tnum]=0
    table.remove(ammofood, i)
    foodos=foodos-1
   else
    i = i + 1
   end
  end
 end
end

function moveplayer1() 
  if key(1) then --left
    p1.x = p1.x-1
    p1.direc = 1
  elseif key(4) then --right
    p1.x = p1.x+1
    p1.direc = 0
  end
  if key(1) or key(4) then
  if p1.cd == 10 then
    p1.cd = 0
    if p1.id == 276 then
      p1.id = 277
    else p1.id = 276
    end
  end
  p1.cd = p1.cd + 1
  end
  
  --if btn(19) and not p1.item then -- down
    --p1.item =
end 

function moveplayer2()
  if key(60) then
    p2.x = p2.x -1
    p2.direc = 0
  elseif key(61) then
    p2.x = p2.x+1
    p2.direc = 1
  end
  if key(60) or key(61) then
  if p2.cd == 10 then
    p2.cd = 0
    if p2.id == 279 then
      p2.id = 278
    else p2.id = 279
    end
  end
  p2.cd = p2.cd + 1
  end
end

function drawplayers()
  
  spr(p1.id,p1.x,y,0,1,p1.direc,0,1,2)

  spr(p2.id,p2.x,y,0,1,p2.direc,0,1,2)

  --add fuctionality for drawing item if picked up
  if p1.item==1 then
    spr(p1.itemid, p1.x+3,y+5,0)
  end
  if p2.item==1 then
    spr(p2.itemid, p2.x-3,y+5,0)
  end
end

function startScreen()
 map(30,0,30,17)
 
 print("Throw food at the other player and\ndodge hits!\nIf you get hit too many times you'll\nsuccumb to a food coma!",25,50,8)
 print("Player 1:",25,80,8)
 print("A/D to move",25,87,8)
 print("S to pick up",25,94,8)
 print("W to throw",25,101,8)
 print("Player 2:",100,80,8)
 print("Left/Right to move",100,87,8)
 print("Down to pick up",100,94,8)
 print("Up to throw",100,101,8)
 
 print("Press Z to start!",75,125,8)
 
 if btnp(4,60,6) then
  section="game"
 end
end

function endScreen()
 map(60,0,30,17)
 --filler
 winner="Player 1"
 accuracy1=tostring(hits1//throws1).."%"
 accuracy2=tostring(hits2//throws2).."%"
 print("GAME OVER",90,10,2)
 print("Winner " .. winner,75,20,8)
 --string formatting is "blah blah" .. input
 --put stats and play again on left side of screen
 print("Player 1 Throws: " .. throws1,6,30,8)
 print("Accuracy: " .. accuracy1,130,30,8)
 print("Player 2 Throws: " .. throws2,6,37,8)
 print("Accuracy: " .. accuracy2,130,37,8)
 
 print("PLAY AGAIN?",6,47,8)
	print("YES",6,56,8)
	print("NO",40,56,8)
 
 if btnp(4,60,6) then
  section="game"
 elseif btnp(5,60,6) then
  cls(2)
  exit()
 end
end

